				},
				["init"] = {
					["do_custom"] = true,
					["custom"] = "--config\naura_env.markOffset = 5 --0 to 5\naura_env.say = true\naura_env.setMarks = false\naura_env.debug = false\n--end\n\naura_env.spellIDGaze = 182006 --Empowered Mannoroth's Gaze\naura_env.spellIDWrath = 186362 --Wrath of Gul'dan\naura_env.numGazes = 3\naura_env.numSoakers = 2\n\naura_env.position = nil\naura_env.player = nil\naura_env.counter = 0",
